 Let’s start by finding out what $1+y$ is.
We know $y=5$.
So $1+y$ is equal to
\begin{align*}
1+y &= 1+5 \\&= \boxed{6}
\end{align*}
### Conclusion: Now, substitute $1+y$ for 6 in the expression $(1+y)^y$:
\begin{align*}
(1+y)^y &= 6^5 \\&= \boxed{7776}
\end{align*}
